import React, { Fragment } from 'react';
import Map from './map';

const dummyText = [
    {
        id : 1,
        name : 'Ismail saheb',
        mobile : '01874631310'
    },
    {
        id : 2,
        name : 'Ismail saheb',
        mobile : '01746313100'
    }
];

function PracticeReact(){

    return (
        <Fragment>
            {
                dummyText.map((axtra) => (
                     <Map key={axtra.id}  maping={axtra}/>
                ))
            }
        </Fragment>
    )
}
export default PracticeReact;




